window.bookSummaryJSON = "<p>In the realm of Ishreedin, humans and elves have a deep animosity for each other that spans centuries. Though fragile peace now exists through a treaty, fate is not often kind to those caught in the middle.&nbsp;</p> <p>Born of a secret marriage between the human king and the elven princess, five half-elven daughters understand—better than anyone—that their fate was signed away long before they were born.&nbsp;After their mother mysteriously disappears, the sisters find themselves at the center of a millennia-old curse, which becomes the catalyst for a whirlwind of events that will throw the five sisters into unknown adventures. Their destinies now hang on the decisions they make while discovering themselves in ways no one knew possible.</p>"; 
